// NewProductPage.js
import React from 'react';
import NewProductForm from '../components/NewProductForm';

const NewProductPage = () => {
  return (
    <div>
      <h2>New Product Form</h2>
      <NewProductForm />
    </div>
  );
};

export default NewProductPage;
